export const People = [
	{
		name: 'John Smith',
        birthmonth: new Date('January 5'),

		birthyear: '1980',
	},
	{
		name: 'Jennifer Goran',
		birthday: new Date('July 4'),
		birthyear: '1992',
	},
	{
		name: 'Peter Miller',
		birthday: new Date('April 16'),
		birthyear: '1978',
	},
	{
		name: 'Shannon Jenkins',
		birthday: new Date('August 9'),
		birthyear: '1954',
	},
];

console.log()

console.log(new Date('January 5').getMonth().getDate());
//=== new Date())
//console.log(People.birthday);
console.log(People.filter((person) => person.birthday === new Date()));
